pragma solidity >=0.4.21 <0.7.0;
pragma experimental ABIEncoderV2;

contract CSCAccessLogger {
    struct RequestTime {
        uint256 miningTime; //the timestamp at which the block was mined
        uint256 requestTime; //the timestamp sent from client claiming request time
    }

    struct CredentialAccess {
        // string SAD;
        string hashes;
        string transactionID; //random value generated by client
        RequestTime accessTime;
    }

    struct SignRequest {
        string signatures;
        RequestTime signTime;
    }

    mapping(string => CredentialAccess[]) accessRequests; // credentialID -> uniqueID
    mapping(string => SignRequest) signRequests; //uniqueID -> timestamp

    mapping(string => uint256) accessRequestsTx; //uniqueID -> index of accessRequests CredentialAccess[]

    function getLastAccessRequest(string memory _credentialID)
        public
        view
        returns (uint256)
    {
        uint256 lastIndex = accessRequests[_credentialID].length == 0
            ? 0
            : accessRequests[_credentialID].length - 1;
        return
            accessRequests[_credentialID][lastIndex].accessTime.requestTime != 0
                ? accessRequests[_credentialID][lastIndex]
                    .accessTime
                    .requestTime
                : 0;
    }
    function getLastAccessRequestTx(
        string memory _credentialID,
        string memory _transactionID
    ) public view returns (uint256) {
        uint256 index = accessRequestsTx[_transactionID];
        return
            accessRequests[_credentialID][index].accessTime.requestTime != 0
                ? accessRequests[_credentialID][index].accessTime.requestTime
                : 0;
    }
    // function getAllAccessRequestTx(
    //     string memory _credentialID,
    //     string[] memory _transactionIDs
    // ) public view returns (uint256) {
    //     string[] memory accessTimes = new string[](_transactionIDs.length - 1);

    //     for (uint256 i = 0; i < _transactionIDs.length; i++) {
    //         uint256 index = accessRequestsTx[_transactionIDs[i]];

    //     }
    //     return
    //         accessRequests[_credentialID][index].accessTime.requestTime != 0
    //             ? accessRequests[_credentialID][index].accessTime.requestTime
    //             : 0;
    // }

    function getLastSignRequest(string memory _credentialID)
        public
        view
        returns (uint256)
    {
        uint256 lastIndex = accessRequests[_credentialID].length == 0
            ? 0
            : accessRequests[_credentialID].length - 1;
        string memory transactionID = accessRequests[_credentialID][lastIndex]
            .transactionID;
        return signRequests[transactionID].signTime.requestTime;
    }

    function getSignRequest(string memory _transactionID)
        public
        view
        returns (uint256)
    {
        return signRequests[_transactionID].signTime.requestTime;
    }

    function getAllAccessRequests(string memory _credentialId)
        public
        view
        returns (uint256[] memory)
    {
        uint256[] memory accessTimes = new uint256[](
            accessRequests[_credentialId].length
        );

        for (uint256 i = 0; i < accessRequests[_credentialId].length; i++)
            accessTimes[i] = (
                accessRequests[_credentialId][i].accessTime.requestTime
            );

        return accessTimes;
    }
    
    function getAllTx(string memory _credentialId)
        public
        view
        returns (string memory)
    {

        string[] memory txIds = new string[](
            accessRequests[_credentialId].length
        );
        string memory result;

        for (uint256 i = 0; i < accessRequests[_credentialId].length; i++){
            txIds[i] = (accessRequests[_credentialId][i].transactionID);
            result=string(abi.encodePacked(result,".",txIds[i]));
        }
        return (result);
    }
    function registerAccessRequest(
        string memory _credentialID,
        string memory _hashes,
        string memory _transactionID,
        uint256 _timestamp
    ) public {
        if (
            bytes(_transactionID).length > 0 &&
            bytes(_credentialID).length > 0 &&
            bytes(_hashes).length > 0
        ) {
            accessRequests[_credentialID].push(
                CredentialAccess({
                    hashes: _hashes,
                    transactionID: _transactionID,
                    accessTime: RequestTime({
                        miningTime: now,
                        requestTime: _timestamp
                    })
                })
            );
            accessRequestsTx[_transactionID] =
                accessRequests[_credentialID].length -
                1;
        }
    }

    function registerSignRequest(
        string memory _transactionID,
        string memory _signatures,
        uint256 _timestamp
    ) public {
        if (bytes(_transactionID).length > 0) {
            signRequests[_transactionID] = SignRequest({
                signatures: _signatures,
                signTime: RequestTime({
                    miningTime: now,
                    requestTime: _timestamp
                })
            });
        }
    }

    // function set(string memory _greeting) public {
    //     greeting = _greeting;
    // }

    // function get() public view returns (string memory){
    //     return greeting;
    // }

}
